import { __decorate } from "tslib";
import { Component } from '@angular/core';
let ProductosComponent = class ProductosComponent {
    constructor(TitleService, meta) {
        this.TitleService = TitleService;
        this.meta = meta;
    }
    ngOnInit() {
        this.loadScripts();
    }
    loadScripts() {
        // This array contains all the files/CDNs 
        const dynamicScripts = [
            'assets/js/vendor/jquery-3.3.1.min.js',
            'assets/js/vendor/modernizr-3.6.0.min.js',
            'assets/js/vendor/jquery.cookie.js',
            'assets/js/vendor/wow.min.js',
            'assets/js/bootstrap.min.js',
            'assets/js/plugins.js',
            'assets/js/popper.min.js',
            'assets/js/lazysizes.js',
            'assets/js/main.js',
            //Load all your script files here'
        ];
        for (let i = 0; i < dynamicScripts.length; i++) {
            const node = document.createElement('script');
            node.src = dynamicScripts[i];
            node.type = 'text/javascript';
            node.async = false;
            document.getElementsByTagName('head')[0].appendChild(node);
        }
    }
};
ProductosComponent = __decorate([
    Component({
        selector: 'app-productos',
        templateUrl: './productos.component.html',
        styleUrls: ['./productos.component.css']
    })
], ProductosComponent);
export { ProductosComponent };
